  true,\n\t\"url\": null,\n\t\"notes\": \"The Federal Ballpark E$timate(R) was developed
  by the Employee Benefit Research Institute(R) and its American Savings Education
  Council(R) (ASEC(R)) program. It is based upon the interactive version of the Ballpark
  E$timate(R) worksheet developed by EBRI and ASEC. Ballpark E$timate(R) is a registered
  trademark of the Employee Benefit Research Institute(R). All rights reserved. Used
  with permission. The Federal Ballpark E$timate (FBE) includes projected Federal
  annuity and Thrift Savings Plan benefits to help users quickly identify approximately
  how much they need to save to fund a comfortable retirement. The data pertain to
  the Civil Service Retirement System (CSRS), CSRS-Offset, and Federal Employees Retirement
  System (FERS).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
